import React from 'react';
import { useAuth } from '../context/AuthContext';

const ProfileSettings = () => {
  const { user } = useAuth();

  return (
    <div className="page">
      <div className="page-header">
        <div>
          <h2>Profile & settings</h2>
          <p className="muted">Manage your account preferences.</p>
        </div>
      </div>

      <div className="card">
        <div className="profile-grid">
          <div>
            <div className="muted">Name</div>
            <div className="strong">{user?.fullName}</div>
          </div>
          <div>
            <div className="muted">Email</div>
            <div className="strong">{user?.email}</div>
          </div>
          <div>
            <div className="muted">Role</div>
            <div className="strong">{user?.role}</div>
          </div>
        </div>
        <button className="btn ghost">Update profile</button>
      </div>
    </div>
  );
};

export default ProfileSettings;
